def calculate_distance_between_cards(card_id_1, card_id_2, conn_params):
    """
    Вычисляет расстояние между векторами двух карточек с использованием pgvector.

    :param card_id_1: ID первой карточки.
    :param card_id_2: ID второй карточки.
    :param conn_params: Параметры подключения к базе данных.
    :return: Расстояние между векторами двух карточек.
    """
    # Подключение к базе данных
    conn = psycopg2.connect(**conn_params)
    cursor = conn.cursor()

    try:
        # SQL-запрос для вычисления расстояния
        query = """
        SELECT 
            p1.id AS card_id_1,
            p2.id AS card_id_2,
            p1.embedding <=> p2.embedding AS distance
        FROM 
            products_all p1, products_all p2
        WHERE 
            p1.id = %s AND p2.id = %s
        """
        # Выполнение запроса
        cursor.execute(query, (card_id_1, card_id_2))
        result = cursor.fetchone()

        if result:
            card_id_1, card_id_2, distance = result
            print(f"Расстояние между карточками {card_id_1} и {card_id_2}: {distance}")
            return distance
        else:
            print(f"Одна из карточек с ID {card_id_1} или {card_id_2} не найдена.")
            return None

    finally:
        # Закрытие соединения
        cursor.close()
        conn.close()


