def fetch_vectors_and_compute_gradient(id1, id2, conn_params):
    """
    Извлекает два вектора из базы данных по id и вычисляет их градиент.
    """
    conn = psycopg2.connect(**conn_params)
    cursor = conn.cursor()

    try:
        # Извлекаем вектора
        query = """
        SELECT embedding 
        FROM products_all
        WHERE id IN (%s, %s)
        ORDER BY id
        """
        cursor.execute(query, (id1, id2))
        vectors = cursor.fetchall()

        if len(vectors) != 2:
            raise ValueError("Не удалось найти оба вектора.")

        # Преобразуем строки в векторы (предполагается, что они в формате строки)
        vector1 = [float(x) for x in vectors[0][0].strip('[]').split(',')]
        vector2 = [float(x) for x in vectors[1][0].strip('[]').split(',')]

        # Вычисляем разницу (градиент) между векторами
        gradient = [v1 - v2 for v1, v2 in zip(vector1, vector2)]

        return gradient

    finally:
        cursor.close()
        conn.close()


