def update_user_embeddings(user_embedding, velocity, gradient, learning_rate, momentum, liked):
    """
    Функция для вычисления нового вектора пользователя с использованием Momentum.

    :param user_embedding: Список векторов предпочтений пользователя (строка в формате списка).
    :param velocity: Список скоростей (Momentum).
    :param gradient: Список градиентов (разницы).
    :param learning_rate: Скорость обучения.
    :param momentum: Коэффициент импульса.
    :param liked: Флаг, нравится ли карточка (True/False).
    :return: Новый вектор пользователя и обновлённое значение velocity (скорость).
    """
    # Преобразуем строки в списки чисел (если входные данные представлены строками)
    vector_user = [float(x) for x in user_embedding.strip('[]').split(',')]
    vector_velocity = [float(x) for x in velocity.strip('[]').split(',')]
    #gradient = [float(x) for x in gradient.strip('[]').split(',')]

    # Скорость обновления (velocity) с использованием Momentum
    if liked:
        # Если карточка понравилась, градиент остаётся положительным
        new_velocity = [momentum * old_v - learning_rate * grad_v
                        for old_v, grad_v in zip(vector_velocity, gradient)]
    else:
        # Если карточка не понравилась, используем противоположный градиент
        new_velocity = [momentum * old_v + learning_rate * grad_v
                        for old_v, grad_v in zip(vector_velocity, gradient)]

    # Обновляем вектор пользователя
    new_user_embedding = [user_v + vel_v for user_v, vel_v in zip(vector_user, new_velocity)]

    # Возвращаем новый вектор пользователя и обновлённое значение velocity
    return str(new_user_embedding), str(new_velocity)


def compute_gradient(user_embedding, item_embedding):
    """
    Вычисляет отрицательный градиент (разницу) между векторами предпочтений пользователя и товара.

    :param user_embedding: Вектор предпочтений пользователя.
    :param item_embedding: Вектор товара.
    :return: Отрицательный градиент, который является разностью между векторами.
    """
    # Преобразуем строки в векторы (предполагается, что они в формате строки)
    vector1 = [float(x) for x in user_embedding.strip('[]').split(',')]
    vector2 = [float(x) for x in item_embedding.strip('[]').split(',')]

    gradient = [(user_v - item_v) for user_v, item_v in zip(vector1, vector2)]

    return gradient

