def generate_zero_list(length=1000):
    """
    Создаёт список строк, где каждая строка представляет число 0.

    :param length: Длина списка.
    :return: Список строк с числом '0'.
    """
    return [0 for _ in range(length)]



def normalize_vector(vector):
    """
    Нормализация вектора.
    Делит каждый элемент вектора на его длину (норму).
    """
    # Вычисление нормы (длины) вектора
    norm = math.sqrt(sum(x ** 2 for x in vector))

    # Проверка на случай, если норма равна 0
    if norm == 0:
        raise ValueError("Невозможно нормировать вектор с нулевой длиной")

    # Нормализация
    normalized_vector = [x / norm for x in vector]
    return normalized_vector


def get_keys_from_json(file_path):
    with open(file_path, 'r', encoding='utf-8') as f:
        data = json.load(f)

    def extract_keys(d, keys_list=None):
        if keys_list is None:
            keys_list = []
        if isinstance(d, dict):
            for key in d:
                keys_list.append(key)
                extract_keys(d[key], keys_list)  # Рекурсивно ищем ключи в вложенных словарях
        elif isinstance(d, list):
            for item in d:
                extract_keys(item, keys_list)  # Для списка проверяем элементы
        return keys_list

    return extract_keys(data)


